import React from "react";

const ErrorComponent = (props: {
    errortitle: string,
    errorBody: string
}) => {
    return (
        <div className="alert alert-warning">
            <h3>{props.errorTitle}</h3>
            <p>{props.errorBody}</p>
        </div>
    );
}
export default ErrorComponent;
